import { Fragment } from "react";
import TodoItem from "./TodoItem";
import classes from "./TodoList.module.css";

const TodoList = (props) => {
  return (
    <Fragment>
      <ul className={classes.list}>
        {props.map((quote) => (
          <QuoteItem
            key={quote.id}
            id={quote.id}
            author={quote.author}
            text={quote.text}
            onFetch={props.onFetch}
          />
        ))}
      </ul>
    </Fragment>
  );
};

export default TodoList;
